import React from 'react';

import './errors.scss';

const LoadingPage = () => (
  <div className="index">
    <div className="errors">
        <img></img>
      <div>Oops, something went wrong with the Yelp request.</div>
      <br/>
      <div>Sorry, please try again in a few moments!</div>
    </div>
  </div>
);

export default LoadingPage;
